type Color = "red" | "blue" | "green";

let color: Color = "red";

switch (color) {
    case "red":
        console.log("red");
        break;
    case "blue":
        console.log("blue");
        break;
    case "green":
        console.log("green");
        break;
}

enum Direction {
    Up,
    Down,
    Left,
    Right,
}
